import React from "react";
import { FcCheckmark } from "react-icons/fc";

const Package = () => {
  return (
    <div className="border" style={{ height: 250, width: 250, margin: 20 }}>
      <div style={{ backgroundColor: "red", color: "white" }}>
        <h4>STANDARD</h4>
        <h5>1700/Sqft</h5>
      </div>

      <div style={{ textAlign: "left", fontSize: 14 }}>
        <FcCheckmark className="col" />
        <p>
          <span className="border col" style={{ textAlign: "justify" }}>
            Structure – branded and high quality cement, steel, concrete, bricks
          </span>
        </p>
        <p>
          <span style={styles.checkMark}>
            <FcCheckmark />
          </span>
          Bare shell – W/O Interiors
        </p>
      </div>
      <button>VIEW MORE</button>
    </div>
  );
};

const styles = {
  checkMark: {
    margin: 5,
  },
};
export default Package;
